$('#pdf-button1').click(function() {
		
        
		 var doc = new jspdf.jsPDF();
  
   
		 var imgData = 'data:image/jpeg;base64,';
	 

    
    
        
		 doc.addImage(imgData, 'PNG',0,0,210,300);
       
		
       
		var name = $('#name').val();
		var adress = $('#adress').val();
		var autor = $('#autor').val();
		var godR = $('#godR').val();
     
        
    const myFile = '';
		// add the font to jsPDF
        doc.addFileToVFS('poi.ttf',myFile);
        doc.addFont('poi.ttf', 'PonterX', 'normal');
        doc.setFont('PonterX');
		doc.setFontSize(26);
		doc.setTextColor(92, 76, 76);
        

        
 
		
		doc.text(23, 190, name);
		doc.text(83, 218, adress);
		doc.text(87, 128, autor);
		doc.text(91, 152, godR);
        
        
       
        doc.save('Письмо.pdf');

		
		
	

	});
    